export const KOP_SEKOLAH_BASE64 =
  "data:image/png;base64,";

export const addKopSurat = (doc) => {
  const pageWidth = doc.internal.pageSize.getWidth(); // 330
  const centerX = pageWidth / 2; // 165
  const margin = 15; // Margin F4

  try {
    //  Gambar Logo
    // (x: 15, y: 12, width: 25, height: 25)
    doc.addImage(KOP_SEKOLAH_BASE64, "PNG", 45, 10, 35, 35);
  } catch (err) {
    console.error("Gagal load logo!", err);
  }

  // Gambar Teks tengah
  doc.setFontSize(14);
  doc.setFont(undefined, "bold");
  doc.text("SEKOLAH MENENGAH KEJURUAN (SMK)", centerX, 15, {
    align: "center",
  });

  doc.setFontSize(16);
  doc.text("SALAFIYAH SYAFIIYAH", centerX, 22, { align: "center" });

  doc.setFontSize(10);
  doc.setFont(undefined, "normal");
  doc.text("DESA BANUROJA KECAMATAN RANDANGAN", centerX, 28, {
    align: "center",
  });
  doc.text("KABUPATEN POHUWATO PROV. GORONTALO", centerX, 33, {
    align: "center",
  });

  doc.setFontSize(10);
  doc.setFont(undefined, "bold");
  doc.text("NSS : 3 2 2 3 0 0 3 0 4 0 0 2", centerX, 38, { align: "center" });

  // Alamat
  doc.setFontSize(9);
  doc.setFont(undefined, "italic");
  doc.text(
    "Alamat Jl. KH. Abdul Ghofir Nawawi Kec. Randangan Kab. Pohuwato Prov. Gorontalo Kode Pos. 96469",
    centerX,
    47,
    { align: "center" }
  );

  //  Garis tebal
  doc.setLineWidth(1.5);
  doc.line(margin, 50, pageWidth - margin, 50);

  //  kembalikan 'Y' buat start tabel
  return 55; // mulai tabel di y=55
};
